import React from 'react';

function Checkbox(props) {
    //const style = props.enabled ? 

    return(
        <div style={{justifyContent:"left"}}>
            <h3 style={{textAlign:"left"}}>{props.name}</h3>
            <input type="checkbox"></input>
        </div>
    );
}

export default Checkbox;
